    color: $main-line;
    width: 100%;
    height: 100%;
    display: grid;
    grid-template-columns: 250px 250px 250px;
    grid-template-rows: 1fr 1fr 1fr 1fr 1fr;
    grid-auto-flow: column;
    justify-items: center;
    justify-content: space-between;
}

.left {
    justify-content: start;
    text-align: left;
    & div {
        align-items: flex-start;
    }
}

.right {
    justify-content: end;
    text-align: right;
    & div {
        align-items: flex-end;
    }
}

.technology-content > div {
    // border: red 1px solid;
    width: 100%;
    height: 100%;
    display: flex;
    align-items: start;
}

.technologyEntry {
    max-height: 200px;
    &__wrapper {
        display: flex;
        flex-direction: column;
    }
}


.technologyName {
    cursor: pointer;
    font-size: 22px;
}

.technologyDescription {
    display: none;
    font-size: 14px;
    ul {
        margin-top: 10px;
        font-size: 12px;
    }
}

.technologyClicked + span {
    display: inline;
}

.title {
    font-size: 1.3rem;
    text-transform: uppercase;
